import React from 'react'
import Blog from './Blog'
import jwt_decode from 'jwt-decode'

const BlogList = ({ blogs, updateLike, user, deleteBlogPost }) => {

  const compare = (a, b) => {
    if (a.likes < b.likes) {
      return 1
    }
    if (a.likes > b.likes) {
      return -1
    }
    return 0
  }
  const sortedBlogs = blogs.sort(compare)
  const decoded_token = jwt_decode(user.token)
  console.log(blogs[10].user.id);
  console.log(decoded_token.id);
  return (
    <div>
      {sortedBlogs.map(blog => (
        <div key={blog.id}>
          <Blog key={blog.id} blog={blog} updateLike={updateLike} user={user} deleteBlogPost={deleteBlogPost}/>
        </div>
      ))}
    </div>
  )
}

export default BlogList
